class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      userFavFood: {
        name: '<NAME>',
        email: 'dbelwp@gmail.com',
        Food: 'Pupusas',
        Why_is_Fav:'I love Pupusas because they are so tasty'
      }
    };
  }
  render (){
    return (
      <div>
        <Info userFavFood = {this.state.userFavFood} />
      </div>
    );
  }
}
